svg.script:

function change_color(id) {

    $.ajax({
        url:'http://localhost:8080/workshop/detail',
        type:'get',
        contentType : 'application/json',
        dataType : 'json',
        data : {id:id},
        timeout:1000,
        async: false,
        success: function(data) {
            var s=JSON.stringify(data);
            alert(s);
        },
        error: function() {
            alert("error");
        }
     });
}
